Primality proof for n = 199:
<p>Take b = 2.
<p>b^(n-1) mod n = 1.
<p><a href=11.html>11 is prime.</a>
<br>b^((n-1)/11)-1 mod n = 60, which is a unit, inverse 136.
<p><a href=3.html>3 is prime.</a>
<br>b^((n-1)/3)-1 mod n = 105, which is a unit, inverse 163.
<p>(3^2 * 11) divides n-1.
<p>(3^2 * 11)^2 > n.
<p>n is prime by Pocklington's theorem.
